'use strict';CKEDITOR.plugins.setLang("a11yhelp","sk",{title:"In\u0161trukcie pr\u00edstupnosti",contents:"Pomocn\u00fd obsah. Pre zatvorenie tohto okna, stla\u010dte ESC.",legend:[{name:"V\u0161eobecne",items:[{name:"Li\u0161ta n\u00e1strojov editora",legend:"Stla\u010dte ${toolbarFocus} pre navig\u00e1ciu na li\u0161tu n\u00e1strojov. Medzi \u010fal\u0161ou a predch\u00e1dzaj\u00facou li\u0161tou n\u00e1strojov sa pohybujete s TAB a SHIFT-TAB. Medzi \u010fal\u0161\u00edm a predch\u00e1dzaj\u00facim tla\u010didlom na li\u0161te n\u00e1strojov sa pohybujete s pravou \u0161\u00edpkou a \u013eavou \u0161\u00edpkou. Stla\u010dte medzern\u00edk alebo ENTER pre aktiv\u00e1ciu tla\u010didla li\u0161ty n\u00e1strojov."},{name:"Editorov\u00fd dial\u00f3g",legend:"V dialogu, stla\u010dte TAB pre navig\u00e1ciu na \u010fal\u0161ie dial\u00f3gov\u00e9 pole, stla\u010dte STIFT + TAB pre presun na predch\u00e1dzaj\u00face pole, stla\u010dte ENTER pre odoslanie dial\u00f3gu, stla\u010dte ESC pre zru\u0161enie dial\u00f3gu. Pre dial\u00f3gy, ktor\u00e9 maj\u00fa viac z\u00e1lo\u017eiek, stla\u010dte ALT + F10 pre navig\u00e1cou do zoznamu z\u00e1lo\u017eiek. Potom sa pos\u00favajte k \u010fal\u0161ej \u017e\u00e1lo\u017eke pomocou TAB alebo pravou \u0161\u00edpkou. Pre presun k predch\u00e1dzaj\u00facej z\u00e1lo\u017eke, stla\u010dte SHIFT + TAB alebo \u013eav\u00fa \u0161\u00edpku. Stla\u010dte medzern\u00edk alebo ENTER pre vybranie z\u00e1lo\u017eky."},{name:"Editorov\u00e9 kontextov\u00e9 menu",legend:"Stla\u010dte ${contextMenu} alebo APPLICATION KEY pre otvorenie kontextov\u00e9ho menu. Potom sa pres\u00favajte na \u010fal\u0161ie mo\u017enosti menu s TAB alebo dolnou \u0161\u00edpkou. Presunte sa k predch\u00e1dzaj\u00facej mo\u017enosti s SHIFT + TAB alebo hornou \u0161\u00edpkou. Stla\u010dte medzern\u00edk alebo ENTER pre v\u00fdber mo\u017enosti menu. Otvorte pod-menu danej mo\u017enosti s medzern\u00edkom, alebo ENTER, alebo pravou \u0161\u00edpkou. Vr\u00e1\u0165te sa sp\u00e4\u0165 do polo\u017eky rodi\u010dovsk\u00e9ho menu s ESC alebo \u013eavou \u0161\u00edpkou. Zatvorte kontextov\u00e9 menu s ESC."},{name:"Editorov box zoznamu",legend:"V boxe zoznamu, presu\u0148te sa na \u010fal\u0161iu polo\u017eku v zozname s TAB alebo dolnou \u0161\u00edpkou. Presu\u0148te sa k predch\u00e1dzaj\u00facej polo\u017eke v zozname so SHIFT + TAB alebo hornou \u0161\u00edpkou. Stla\u010dte medzern\u00edk alebo ENTER pre v\u00fdber mo\u017enosti zoznamu. Stla\u010dte ESC pre zatvorenie boxu zoznamu."},{name:"Editorove p\u00e1smo cesty prvku",legend:"Stla\u010dte ${elementsPathFocus} pre navigovanie na p\u00e1smo cesty elementu. Presu\u0148te sa na tla\u010didlo \u010fal\u0161ieho prvku s TAB alebo pravou \u0161\u00edpkou. Presu\u0148te sa k predch\u00e1dzaj\u00facemu tla\u010didlu s SHIFT + TAB alebo \u013eavou \u0161\u00edpkou. Stla\u010dte medzern\u00edk alebo ENTER pre v\u00fdber prvku v editore."}]},{name:"Pr\u00edkazy",items:[{name:"Vr\u00e1ti\u0165 pr\u00edkazy",legend:"Stla\u010dte ${undo}"},{name:"Nanovo vr\u00e1ti\u0165 pr\u00edkaz",legend:"Stla\u010dte ${redo}"},{name:"Pr\u00edkaz na stu\u010dnenie",legend:"Stla\u010dte ${bold}"},{name:"Pr\u00edkaz na kurz\u00edvu",legend:"Stla\u010dte ${italic}"},{name:"Pr\u00edkaz na pod\u010diarknutie",legend:"Stla\u010dte ${underline}"},{name:"Pr\u00edkaz na odkaz",legend:"Stla\u010dte ${link}"},{name:"Pr\u00edkaz na zbalenie li\u0161ty n\u00e1strojov",legend:"Stla\u010dte ${toolbarCollapse}"},{name:" Access previous focus space command",legend:"Press ${accessPreviousSpace} to access the closest unreachable focus space before the caret, for example: two adjacent HR elements. Repeat the key combination to reach distant focus spaces."},{name:" Access next focus space command",legend:"Press ${accessNextSpace} to access the closest unreachable focus space after the caret, for example: two adjacent HR elements. Repeat the key combination to reach distant focus spaces."},{name:"Pomoc pr\u00edstupnosti",legend:"Stla\u010dte ${a11yHelp}"}]}]});